import React from 'react';
import coins from "../../img/div.recent-exchanges__item-pair.svg"
import coinsPerv from "../../img/→.svg"
const Exchanges = () => {
    return (
        <div id="exchanges">
            <div className="container">
                <div>
                    <div className="green">
                        <img src={coins} alt=""/>
                        <h3>30000 Житомир USD</h3>
                        <img src={coinsPerv} alt=""/>
                        <h3>29411.76 Tether TRC20</h3>
                        <h3>USDT</h3>
                        <h4>8 июля 2023 г. в <br/> 17:33</h4>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Exchanges;
